import React from 'react';
import { Link } from 'react-router-dom';

interface Product {
  id: number;
  name: string;
  price: number;
  image: string;
  farmer: string;
  rating: number;
}

const sampleProducts: Product[] = [
  {
    id: 1,
    name: '요플렛',
    price: 4900,
    image: '/images/onion.jpg',
    farmer: '행복한 농장',
    rating: 4.5
  },
  {
    id: 2,
    name: '부대찌개 밀키트',
    price: 7900,
    image: '/images/potato.jpg',
    farmer: '감자 농장',
    rating: 4.8
  },
  // 더 많은 상품 추가 가능
];

const categories = ['전체', '채소', '과일', '곡물', '견과류', '버섯', '양념채소'];

export const HomePage: React.FC = () => {
  return (
    <div className="min-h-screen bg-[#F8FAF7]">
      {/* 네비게이션 바 */}
      <nav className="bg-white shadow-sm">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            <div className="flex items-center">
              <Link to="/" className="text-2xl font-bold text-[#4CAF50]">
                COOKFARM
              </Link>
            </div>
            <div className="flex-1 max-w-2xl mx-4">
              <div className="relative">
                <input
                  type="text"
                  placeholder="식재료를 입력하세요"
                  className="w-full px-4 py-2 rounded-lg border border-gray-300 focus:border-[#4CAF50] focus:ring-1 focus:ring-[#4CAF50] focus:outline-none"
                />
                <button className="absolute right-3 top-2.5 text-gray-400 hover:text-[#4CAF50]">
                  <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
                  </svg>
                </button>
              </div>
            </div>
            <div className="flex items-center">
              <Link
                to="/login"
                className="inline-flex items-center px-4 py-2 border border-[#4CAF50] text-sm font-medium rounded-md text-[#4CAF50] hover:bg-[#4CAF50] hover:text-white transition-colors"
              >
                로그인
              </Link>
            </div>
          </div>
        </div>
      </nav>

      {/* 메인 컨텐츠 */}
      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        {/* 카테고리 */}
        <div className="mb-8">
          <div className="flex space-x-4 overflow-x-auto pb-4">
            {categories.map((category, index) => (
              <button
                key={index}
                className={`px-4 py-2 rounded-full text-sm font-medium whitespace-nowrap
                  ${index === 0
                    ? 'bg-[#4CAF50] text-white'
                    : 'bg-white text-gray-600 hover:bg-[#E8F5E9] hover:text-[#4CAF50]'
                  }`}
              >
                {category}
              </button>
            ))}
          </div>
        </div>

        {/* 상품 그리드 */}
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
          {sampleProducts.map((product) => (
            <div key={product.id} className="bg-white rounded-lg shadow-sm hover:shadow-md transition-shadow p-4">
              <h3 className="text-lg font-medium text-gray-900 mb-1">{product.name}</h3>
              <p className="text-sm text-gray-500 mb-2">{product.farmer}</p>

              <div className="flex items-center mb-2">
                {[...Array(5)].map((_, i) => (
                  <svg
                    key={i}
                    className={`w-4 h-4 ${i < product.rating ? 'text-yellow-400' : 'text-gray-300'}`}
                    fill="currentColor"
                    viewBox="0 0 20 20"
                  >
                    <path d="M9.049 2.927c.3-.921 1.603-.921 1.902 0l1.07 3.292a1 1 0 00.95.69h3.462c.969 0 1.371 1.24.588 1.81l-2.8 2.034a1 1 0 00-.364 1.118l1.07 3.292c.3.921-.755 1.688-1.54 1.118l-2.8-2.034a1 1 0 00-1.175 0l-2.8 2.034c-.784.57-1.838-.197-1.539-1.118l1.07-3.292a1 1 0 00-.364-1.118L2.98 8.72c-.783-.57-.38-1.81.588-1.81h3.461a1 1 0 00.951-.69l1.07-3.292z" />
                  </svg>
                ))}
                <span className="ml-1 text-sm text-gray-500">({product.rating})</span>
              </div>

              <div className="flex justify-between items-center">
                <span className="text-lg font-bold text-[#4CAF50]">
                  {product.price.toLocaleString()}원
                </span>
                <button className="px-3 py-1 bg-[#4CAF50] text-white rounded-lg text-sm hover:bg-[#45a049]">
                  삭제
                </button>
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};
